import React, { useState } from "react";
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import './Reportstyles.css';

function ReportPage() {

    const navigate = useNavigate(); // Initialize the navigate function

    const handleGetStartedClickStory = () => {
        navigate('/StoryPage'); 
      };

    return (
        <div className="background">
            <div className="reportSection">
                <div className="reportInfo">
                    <p>REPORT NUMBER:</p>
                    <p>USER's TEST TIME:</p>
                </div>
                <div className="stressSection">
                    <div className="stressInfo">
                        <h2 style={{ fontSize: '64px', paddingBottom: '37px', margin: '0'}}>Stress: Moderate</h2>
                        <p style={{ fontSize: '40px', lineHeight: '1.5'}}>Throughout your caregiving, you've tackled 10 stress challenges, putting your stress tolerance above 43% of others.</p>
                        <button className="readBtn" onClick={handleGetStartedClickStory}>Read our story</button>
                    </div>
                    <div className="stressBrain">
                        <div className="totalScore">
                            Total Score:
                        </div>
                        <div className="brainImage">

                        </div>
                    </div>
                </div>
            </div>
        </div>
    );








}
export default ReportPage;
